import React from "react";
import {
    Box,
    Icon,
    Button,
    Fab,
    styled,
    TablePagination,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
} from "@mui/material";
import { SimpleCard } from "app/components";
import { useState, useEffect,useParams } from "react";
import { Link, Navigate } from "react-router-dom";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogTitle from "@mui/material/DialogTitle";
import Slide from "@mui/material/Slide";
import { toast } from "react-toastify";
import { getquetionList } from "app/apis/apiMethods";
import FormControlLabel from "@mui/material/FormControlLabel";
import FormLabel from "@mui/material/FormLabel";
import Radio from "@mui/material/Radio";


const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="up" ref={ref} {...props} />;
});

const Container = styled("div")(({ theme }) => ({
    margin: "30px",
    [theme.breakpoints.down("sm")]: { margin: "16px" },
    "& .breadcrumb": {
        marginBottom: "30px",
        [theme.breakpoints.down("sm")]: { marginBottom: "16px" },
    },
}));

const StyledTable = styled(Table)(({ theme }) => ({
    whiteSpace: "pre",
    "& thead": {
        "& tr": { "& th": { paddingLeft: 0, paddingRight: 0 } },
    },
    "& tbody": {
        "& tr": { "& td": { paddingLeft: 0, textTransform: "capitalize" } },
    },
}));

const StyledButton = styled(Button)(({ theme }) => ({
    margin: theme.spacing(1),
}));

export default function QuestionList() {
    const [state, setState] = useState([]);
    const [page, setPage] = useState(0);
    const [rowsPerPage, setRowsPerPage] = useState(5);
    const [open, setOpen] = React.useState(false);
    const [userID, setUserID] = useState("");

    let { id } = match.params.id;

    function handleClickOpen(id) {
        setOpen(true);
        setUserID(id);
    }
    function handleClose() {
        setOpen(false);
    }


    const questionList = async () => {
        const users = await getquetionList();
        console.log('users.data.data', users);
        setState(users.data);
    };

    useEffect(() => {
        questionList();
    }, []);
    return (
        <Container>
            <Box width="100%" overflow="auto">
                <SimpleCard>
                    <StyledTable>
                        <TableHead>
                            <TableRow>
                                <TableCell align="center" >S.No</TableCell>
                                <TableCell align="center">title</TableCell>
                                <TableCell aligen="center">Options</TableCell>
                                <TableCell align="center">Action</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {state && state
                                .map((item, index) => {
                                 console.log('item, index', item, index);
                                    return (
                                        <TableRow key={index}>
                                            <TableCell align="center">{index + 1}</TableCell>
                                            <TableCell align="center" variant="contained" color="primary" >
                                                    {item.title}
                                             </TableCell>
                                             <TableCell>

                                                {item.questionType == 'Radio' && item?.options.map((item,mykey)=>{
                                                        return(
                                                            <>
                                                            <TableRow key={mykey}><TableCell align="right" ><input type="radio" id={`coustomradio${index}`} name={`coustomradio${index}`} /> {item.text}</TableCell></TableRow>
                                                            </>
                                                        )
                                                        })}
                                                        {item.questionType == 'Checkbox' && item?.options.map((item,mykey)=>{
                                                        return(
                                                            <>
                                                            <TableRow key={mykey}><TableCell align="right" ><input type="Checkbox" id={`coustomradio${index}`} name={`coustomradio${index}`} /> {item.text}</TableCell></TableRow>
                                                            </>
                                                        )
                                                        })}
                                                        {item.questionType == 'Bool' && item?.options.map((item,mykey)=>{
                                                        return(
                                                            <>
                                                            <TableRow key={mykey}><TableCell align="right" ><input type="radio" id={`coustomradio${index}`} name={`coustomradio${index}`} /> {item.text}</TableCell></TableRow>
                                                            </>
                                                        )
                                                        })}
                                               </TableCell>
                                               <TableCell align="center">
                                                <StyledButton variant="contained" color="primary" >
                                                    answer
                                                </StyledButton>
                                            </TableCell>
                                        </TableRow>
                                    )
                                })}

                            <Dialog
                                open={open}
                                keepMounted
                                onClose={handleClose}
                                TransitionComponent={Transition}
                                aria-labelledby="alert-dialog-slide-title"
                                aria-describedby="alert-dialog-slide-description"
                            >
                            </Dialog>
                        </TableBody>
                    </StyledTable>
                </SimpleCard>
            </Box>
        </Container>
    );
}
